import React from 'react';
import './Footer.css';

function Footer() {
    return (
        <footer className = "footer">
            <div className = "intro">웹소개</div>
            <div className = "contact">고객문의</div>
            <div className = "terms-of-use">이용약관</div>
        </footer>
    );
}

export default Footer;
